import React, { Component } from 'react'
import GridElement from './gridelement'
import Data from '../content/data.json'

console.log(Data)

export default class Grid extends Component {
	render() {
		return (
			<section className="tiles">
				{Data.map(entry => {
					<div>
						{entry.title}
					</div>
				})}
			</section>
		)
	}
}
